import React from 'react'
import styled from "styled-components";

const Header = (props) => {
  return (
    <Container>
      <Content>
        <Logo>
          <a href="/home">
            <img src="/images/home-logo.svg" />
          </a>
        </Logo>
      </Content>
    </Container>
  )
}
const Container = styled.div`
    background: white;
    border-bottom: 1px solid rgba(0, 0, 0, 0.08);
    left:0;
    top:0;
    padding: 0 24px;
    position: fixed;
    width: 100vw;
    z-index: 100;
`;
const Content = styled.div`
    display: flex;
    align-items:center;
    margin: 0 auto;
    min-height: 100%;
    max-width: 1128px;
`;
const Logo = styled.div`
  position: relative;
  top: 0;
  left: 0;
  padding: 10px;
  margin-right: 8px;
`;
export default Header;
